import LandingPage from "./components/LandingPage"
import Details from "./components/Details"
import JoinCommunity from "./components/JoinCommunity"
import Navbar from "./components/Navbar"

import './App.css'; 

function App() {
  return (
    <>
        <Navbar/>
        <LandingPage/>
        <Details />        
        <JoinCommunity />
    </>
  );
}

export default App;
